import {
  MainPageContainer,
  MainPageContainerSection,
  Title,
} from "../Styles/Mainpage.style";
export const Mainpage = () => {
  return (
    <MainPageContainer>
      <Title>Featured Video</Title>
      <Card />
      <MainPageContainerSection>
        <Title>Featured Video</Title>

      </MainPageContainerSection>
    </MainPageContainer>
  );
};
